        <>
        <ul>{peoples.map((e) => <li><h2>{e.name}</h2>
        <h2>{e.age}</h2></li>)}</ul>
        <h1>maior 18</h1>
        <ul>{maior18.map((e) => <li><h2>{e.name}</h2>
        <h2>{e.age}</h2></li>)}</ul>
        </>
    )
}

export default PartyList
